import React from 'react';
import './Lsection.css'
import Nav1 from '../Nav1/Nav1';
import Section1 from '../Section1/Section1';

const Lsection = () => {
  return (

    <header>

        <Section1 />


        <div className="body_containt">

            <Nav1 />

            <nav className="nav_2">
                <a href="#">Tableau de bord</a>
                <a href="#">Fichiers</a>
